import turtlefrom turtle import left, right, forwardsize = 10def hilbert(level, angle):    if level == 0:        return    turtle.color("Blue")    turtle.speed(1)    right(angle)    hilbert(level - 1, -angle)    forward(size)    left(angle)    hilbert(level - 1, angle)    forward(size)    hilbert(level - 1, angle)    left(angle)    forward(size)    hilbert(level - 1, -angle)    right(angle)if __name__ == '__main__':    hilbert(3, 90)    a = 1